import React from "react";

const logo = props => {
    const styles = {
        display: "block",
        height: "100%",
        width: "20px"
    }

    return (
        <a className="btn btn-sm btn-primary" styles={{lineHeight: "100%"}}>
            <img src={props.src} style={styles}/>
        </a>
    )
};

export default logo;
